import React from 'react';
import "./AddReview.css";
import Header from './Header';
import Frame from 'react-frame-component';
function AddReview() {
  return (
    <div className='body' >
    <Header/>

    <div className="wrapper">
    <form className="form">
      <h3 className="pageTitle">
      Course Review </h3>
      <h4 clasName="secondaryTitle">
      Please fill this form for course review</h4>
      <input type="text" className="name" placeholder="Student Name" />
      <input type="text" className="email" placeholder="Course Title"/>
      <textarea className="message" placeholder="Review"></textarea>
         <button className="submit" >Submit</button>
    </form>
  </div>


    </div>
  )
}

export default AddReview
